import React, { useState } from 'react';
import data from './data';
import List from './List';

function App() {
  return (
    <div className="d-flex justify-content-center align-items-center ">
      <div
        className="m-auto p-auto"
        style={{
          height: "25rem",
          margin: "auto",
          width: "50vh",
          backGround: "black",
        }}
      >
        {data?.map((item) => (
          <div>
            <List key={item.id} {...item} />
          </div>
        ))}
      </div>
    </div>
  );
}

export default App;
